[save_variables]
filename: /home/dinec/S8_data/config/saved_variables.cfg

[printer]
kinematics: cartesian
max_velocity: 350
max_accel: 6000
square_corner_velocity: 5.0
max_z_velocity: 20
max_z_accel: 100

############################################
#Steppers
############################################
[input_shaper] 
#shaper_freq_x: 62.2
#shaper_type_x: mzv
#shaper_freq_y: 37.4
#shaper_type_y: mzv

[stepper_x]
step_pin: PA15
dir_pin: PA8
enable_pin: !PD1
microsteps: 16
#rotation_distance: 40
rotation_distance: 40.064620355412 
endstop_pin: ^PC1
#position_endstop: -2
#position_min: -2
position_endstop: -6.5
position_min: -6.5
#position_max: 329
position_max: 333
homing_speed: 75

[tmc2209 stepper_x]
uart_pin: PD0
#run_current: 1.100 #old stepperonline 42-38
run_current: 1.000 #new stepperonline 42-38
#hold_current: 0.900
stealthchop_threshold: 999999

[stepper_y]
step_pin: PE2
dir_pin: !PE3
enable_pin: !PE0
microsteps: 16
#rotation_distance: 40
rotation_distance: 40.129449838188 
endstop_pin: ^!PC3
position_endstop: -51.5
position_min: -55.1
position_max: 312
homing_speed: 75

[tmc2209 stepper_y]
uart_pin: PE1
#run_current: 1.100 #old stepperonline 42-38
run_current: 1.000 #new stepperonline 42-38
#hold_current: 0.900
stealthchop_threshold: 999999

[stepper_z]
step_pin: PD15
dir_pin: !PD14
enable_pin: !PC7
microsteps: 16
#rotation_distance: 8
rotation_distance: 7.9791583872
endstop_pin: probe:z_virtual_endstop
#position_endstop: 0.0
position_max: 420 #400 by default
position_min: -5 ; Make sure to comment out normally. For Z offset calibration
#position_min: 0 ;
homing_speed: 10
homing_retract_dist: 0 # cartographer needs this to be set to 0

[tmc2209 stepper_z]
uart_pin: PC6
run_current: 0.400
hold_current: 0.150
stealthchop_threshold: 999999

[stepper_z1]
step_pin: PD11
dir_pin: !PD10
enable_pin: !PD13
microsteps: 16
rotation_distance: 8

[tmc2209 stepper_z1]
uart_pin: PD12
run_current: 0.400
hold_current: 0.150
stealthchop_threshold: 999999

[extruder] #Orbiter 2 Clone
#step_pin: P2.13
step_pin: EBBCan: PD0
#dir_pin: P0.11
dir_pin: EBBCan: PD1
#enable_pin: !P2.12
enable_pin: !EBBCan: PD2
microsteps: 16
full_steps_per_rotation: 200
#rotation_distance: 4.748288
rotation_distance: 4.720037076
nozzle_diameter: 0.800
filament_diameter: 1.750
#heater_pin: P2.7
heater_pin: EBBCan: PB13
sensor_type: MAX31865
sensor_pin: EBBCan: PA4
spi_bus: spi1
rtd_nominal_r: 100
rtd_reference_r: 430
rtd_num_of_wires: 2
#control: pid
#pid_Kp: 22.2
#pid_Ki: 1.08
#pid_Kd: 114
min_temp: 0
max_temp: 300
min_extrude_temp: 175
#max_extrude_only_distance: 500
max_extrude_only_distance: 200
max_extrude_only_velocity: 120
#max_extrude_cross_section: 5
max_extrude_cross_section: 50.0

[tmc2209 extruder]
uart_pin: EBBCan: PA15
interpolate: True
run_current: 0.650
hold_current: 0.350
sense_resistor: 0.11
stealthchop_threshold: 0
driver_TBL: 0
driver_HEND: 6
driver_HSTRT: 7
driver_TOFF: 4

